import React, { useState, useEffect } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import moment from 'moment';
import { format } from 'date-fns';
import { parseEventText } from '/Users/wenxinmiao/Desktop/PlanWise/client/src/Services/openAIservice.js';

function SmartEventEntry() {
  const [events, setEvents] = useState([]);
  const [inputText, setInputText] = useState('');
  const [isProcessing, setIsProcessing] = useState(false);
  const [chatHistory, setChatHistory] = useState([
    {
      sender: 'assistant',
      text: 'Welcome to Smart Event Entry! Type an event in natural language like "Lunch with Sarah next Friday at noon" and I\'ll add it to your calendar.'
    }
  ]);

  // Load saved events from local storage
  useEffect(() => {
    const savedEvents = localStorage.getItem('events');
    if (savedEvents) {
      // Convert string dates back to Date objects
      const parsedEvents = JSON.parse(savedEvents).map(event => ({
        ...event,
        start: new Date(event.start),
        end: new Date(event.end)
      }));
      setEvents(parsedEvents);
    }
  }, []);

  // Save events to local storage when updated
  useEffect(() => {
    if (events.length > 0) {
      localStorage.setItem('events', JSON.stringify(events));
    }
  }, [events]);

  const handleInputChange = (e) => {
    setInputText(e.target.value);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && inputText.trim()) {
      handleSubmit();
    }
  };

  const handleSubmit = async () => {
    if (!inputText.trim() || isProcessing) return;

    // Add user message to chat
    setChatHistory(prev => [
      ...prev,
      { sender: 'user', text: inputText }
    ]);

    setIsProcessing(true);

    // Add processing message
    setChatHistory(prev => [
      ...prev,
      { sender: 'assistant', text: 'Analyzing your request...', isProcessing: true }
    ]);

    try {
      // Use OpenAI to parse the input text into an event
      const newEvent = await parseEventText(inputText);

      // Add the new event to the calendar
      setEvents(prevEvents => [...prevEvents, newEvent]);

      // Format the dates for display
      const startFormatted = format(newEvent.start, 'EEEE, MMMM d, yyyy h:mm a');
      const endFormatted = format(newEvent.end, 'h:mm a');

      // Update chat history by replacing the processing message with the result
      setChatHistory(prev => [
        ...prev.filter(msg => !msg.isProcessing),
        { 
          sender: 'assistant', 
          text: `Added "${newEvent.title}" to your calendar on ${startFormatted} to ${endFormatted}.`
        }
      ]);

      // Display additional event details if available
      if (newEvent.location || newEvent.notes) {
        const detailsText = [];
        if (newEvent.location) detailsText.push(`Location: ${newEvent.location}`);
        if (newEvent.notes) detailsText.push(`Notes: ${newEvent.notes}`);

        setChatHistory(prev => [
          ...prev,
          { sender: 'assistant', text: detailsText.join('\n') }
        ]);
      }
    } catch (error) {
      console.error('Error processing event:', error);

      // Update chat history with error message
      setChatHistory(prev => [
        ...prev.filter(msg => !msg.isProcessing),
        { 
          sender: 'assistant', 
          text: 'Sorry, I had trouble understanding that. Could you try rephrasing with a clear date and time?'
        }
      ]);
    } finally {
      setIsProcessing(false);
      setInputText('');
    }
  };

  const localizer = momentLocalizer(moment);

  return (
    <div className="flex flex-col h-screen">
      <div className="flex-1 p-6 overflow-hidden">
        {/* Calendar view */}
        <div className="bg-white shadow-md rounded-lg p-4 h-full">
        // In SmartEventEntry.js, update the Calendar component
          <Calendar
            localizer={momentLocalizer(moment)}
            events={events}
            startAccessor="start"
            endAccessor="end"
            style={{ height: '100%' }}
            views={['month', 'week', 'day']}
            onNavigate={(date) => console.log('Navigating to:', date)} // Add logging for debugging
            onView={(view) => console.log('Changing view to:', view)}   // Add logging for debugging
            // Ensure the calendar is re-rendered when props change
            key={`calendar-${events.length}`}
          />
        </div>
      </div>

      {/* Chat interface */}
      <div className="bg-white shadow-md h-72 border-t">
        <div className="flex flex-col h-full">
          <div className="flex-1 p-4 overflow-y-auto">
            {chatHistory.map((message, index) => (
              <div
                key={index}
                className={`mb-3 ${
                  message.sender === 'user' ? 'text-right' : 'text-left'
                }`}
              >
                <div
                  className={`inline-block p-3 rounded-lg ${
                    message.sender === 'user'
                      ? 'bg-primary text-white'
                      : 'bg-secondary text-gray-800'
                  }`}
                >
                  {message.text}
                </div>
              </div>
            ))}
          </div>
          <div className="p-4 border-t flex">
            <input
              type="text"
              className="flex-1 mr-2 input"
              placeholder="Add an event in natural language..."
              value={inputText}
              onChange={handleInputChange}
              onKeyPress={handleKeyPress}
              disabled={isProcessing}
            />
            <button
              className={`btn btn-primary ${isProcessing ? 'opacity-50 cursor-not-allowed' : ''}`}
              onClick={handleSubmit}
              disabled={!inputText.trim() || isProcessing}
            >
              {isProcessing ? 'Processing...' : 'Add'}
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SmartEventEntry;
